                        editMode = {true}
                    />
                    {/*<Question qText = {question.qText}*/}
                    {/*          qType = {question.qType}*/}
                    {/*          qDate = {question.qDate}*/}
                    {/*          qChoices = {question.qChoices}*/}
                    {/*          editMode = {true}*/}
                    {/*/>*/}
                </li>
            ):<></>}
            <div className="SubmitButton">
                <button>Save</button>
            </div>
        </div>
    );
}
export default EditQuestions
